import Home from "./Components/Home";
import './App.css';
import { Route, Routes } from 'react-router-dom'; // Import routing components
import Rating from "./Components/Rating";
import Parents from "./Components/Parents";

const App = () => {
  return (
    <>
      <Home />
      <div className="app-content">
        <Routes>
          <Route 
            path="/" 
            element={<Rating />} 

          />
        </Routes>
      </div>
    </>
  );
}

export default App;
